`to5.transform("function* f(xs) {return [for (x of xs) yield x] }", {experimental: true})` generates code involving:

    _toArray(xs).map(function (x) {
          return yield x;
    })

which is not valid ES5 since the `yield` is still there. The same is true of `await`. Using `[for (x of xs) for (y of ys) yield (x+y)]` no longer uses `map`, but still leaves the `yield` in there.

I don't know if `await`/`yield` in list comprehensions is allowed. If it isn't, it should give a compile error rather than generating invalid code.

